import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';
import { Schedule } from '../models/schedule.model';

@Injectable({
  providedIn: 'root'
})
export class ScheduleAPIService {

  constructor(private http: HttpClient) { }

  getSchedules() : Observable<Schedule[]> {
    const schedules = [
      {
        name: 'Test',
        startDate: '1/1/2022',
        endDate: '2/1/2022',
        submissionDateTime : '12/31/2021 15:00:00z',
        status: 'Success',
        icon: 'bg-success'
      },
      {
        name: 'Test',
        startDate: '1/1/2023',
        endDate: '2/1/2023',
        submissionDateTime : '12/31/2022 15:00:00z',
        status: 'Pending',
        icon: 'bg-info'
      }
    ];

    return of(schedules);
  }
}
